import React, { useState } from "react";
import "./Navbar.css";
import logo from "../images/logoB.png";
import name from "../images/nameB.png";
import Modal from "react-modal";
import SignUp from "./SignUp";
import { IoIosClose } from "react-icons/io";

Modal.setAppElement("#root");

export default function Navbar() {
  const [loginIsOpen, setLoginIsOpen] = useState(true);

  return (
    <div className="bar">
      <div className="brand">
        <img src={logo} alt="Logo" className="logo" />
        <img src={name} alt="Name" className="name" />
      </div>
      <div className="buttons">
        <button>LOG IN</button>
        <button onClick={() => setLoginIsOpen(true)}>SIGN UP</button>

        <Modal
          className="content"
          overlayClassName="overlay"
          isOpen={loginIsOpen}
          onRequestClose={() => setLoginIsOpen(false)}
        >
          <button className="close" onClick={() => setLoginIsOpen(false)}>
            <IoIosClose
              style={{
                height: "120px",
              }}
            />
          </button>
          <SignUp />
        </Modal>
      </div>
    </div>
  );
}
